pragma solidity 0.8.17;

import {Buffer} from "./Buffer.sol";
import {BufferBase} from "./BufferBase.sol";

library RequestLib {
  using Buffer for BufferBase.buffer;

  struct Request {
    bytes32 id;
    address callbackAddress;
    bytes4 callbackFunctionId;
    BufferBase.buffer requestData;
  }

  function initialize(
    Request memory self,
    address callbackAddr,
    bytes4 callbackFunc
  ) internal pure returns (Request memory) {
    self.callbackAddress = callbackAddr;
    self.callbackFunctionId = callbackFunc;
    return self;
  }

  function setId(Request memory self, bytes32 id) internal pure {
    self.id = id;
  }

  function add(Request memory self, string memory key, string memory value) internal pure {
    self.requestData.encodeString(key);
    self.requestData.encodeString(value);
  }

  function addHeader(Request memory self, string memory headerKey, string memory value) internal pure {
    self.requestData.encodeString(" header(");
    self.requestData.encodeString(headerKey);
    self.requestData.encodeString(value);
    self.requestData.encodeString(") ");
  }
}","keccak256":"0xf8f70cb860bdc2202257a50ef25d755d31ccebcf9ffb900f8df3e9045831fd53","license":"UNLICENSED"},"contracts/pull/HttpRequestOracle.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.17;

import "@openzeppelin/contracts/access/Ownable.sol";
import "../lib/RequestLib.sol";

error OnlyReporter();

contract HttpRequestOracle is Ownable {
  using RequestLib for RequestLib.Request;

  mapping(address => bool) reporters;

  event RequestSent(bytes32 indexed id, bytes data);
  event RequestFulfilled(bytes32 indexed id);
  event RequestCancelled(bytes32 indexed id);

  function updateReporter(address reporterAddress, bool isReporter) external onlyOwner {
    reporters[reporterAddress] = isReporter;
  }

  function getReporter(address reporterAddress) external view returns (bool) {
    return reporters[reporterAddress];
  }

  function _hasReporter(address reporterAddress) private view returns (bool) {
    return reporters[reporterAddress];
  }

  function sendRequest(RequestLib.Request memory req) external returns (bytes32) {
    bytes memory encodedRequest = abi.encodeWithSelector(
      this.updateReporter.selector,
      req.id,
      req.callbackFunctionId,
      req.requestData.buf
    );
    emit RequestSent(req.id, encodedRequest);
    return req.id;
  }
}","keccak256":"0xc69e4f20d24c112f1a3effb2b7c0b0af033f172d94ced2149c73195e9e2f7d04","license":"UNLICENSED"},"contracts/pull/HttpRequestWithHeader.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
pragma solidity 0.8.17;

import "./HttpRequestOracle.sol";
import "./RequestConsumer.sol";

contract HttpRequestConsumerWithHeader is RequestConsumer {
  using RequestLib for RequestLib.Request;

  HttpRequestOracle httpOracle;
  string prediction_signal;

  event RequestExchangeRate(bytes32 indexed requestId, string prediction_signal);

  constructor(address _oracle) {
    httpOracle = HttpRequestOracle(_oracle);
  }

  function requestPredictionSignal() private returns (bytes32) {
    RequestLib.Request memory req = buildRequest(this._requestedDataCompleted.selector);
    req.setId(keccak256(abi.encodePacked(block.timestamp, msg.sender)));

    // The code above is the same as
    // const request = require('request');

    // request.get({
    //   url: 'https://api.api-ninjas.com/v1/exchangerate?pair=USD_EUR',
    //   headers: {
    //     'X-Api-Key': 'YOUR_API_KEY'
    //   },
    // }, function(error, response, body) {
    //   if(error) return console.error('Request failed:', error);
    //   else if(response.statusCode != 200) return console.error('Error:', response.statusCode, body.toString('utf8'));
    //   else console.log(body)
    // });

    req.add("get", "https://api.scobrudot.dev/data/");
    req.addHeader("Authorization", "EFB5C6729D8CE3E03FD03AEC340540B24A788454D45E717089B1E59243E16F43");

    // Set the path to find the desired data in the API response, where the response format is:
    //  {
    //   "currency_pair": "USD_EUR",
    //   "exchange_rate": 0.826641
    // }
    req.add("path", "prediction_signal");
    httpOracle.sendRequest(req);
    return req.id;
  }

  function _requestedDataCompleted(bytes32 _requestId, string memory _prediction_signal) public {
    emit RequestExchangeRate(_requestId, _prediction_signal);
    prediction_signal = _prediction_signal;
  }
}","keccak256":"0x80f6aaf7f6584fa45305b1354e9799b7e6c86e4a4659ee122daf8fff28d9aa28","license":"UNLICENSED"},"contracts/pull/RequestConsumer.sol":{"content":"// SPDX-License-Identifier: UNLICENSED
